import React from 'react';

function Card(props){

    return(
        <>
        <div className = "main-box"></div>
        <div className = "card-box">
        <img src={props.imgscr}/>
        <p>{props.title}</p>
        <h1>{props.sname}</h1>
         <a href={props.link} target ="_blank">Click Me </a>
        </div>
        </>
    );

}
export default Card;
